GROUP_ENEMIES_ONE = [1,2,3,4]
GROUP_ENEMIES_TWO = [5,6,7,8]
ALL_ENEMIES = GROUP_ENEMIES_ONE + GROUP_ENEMIES_TWO

n_hidden_neurons = 10

env = Environment(experiment_name="final_run",
                  enemies=ALL_ENEMIES,
                  multiplemode = "yes",
                  playermode="ai",
                  player_controller=player_controller(n_hidden_neurons),
                  enemymode="static",
                  level=2,
                  speed="fastest",
                  contacthurt="player",
                  randomini="yes"
)

@dataclass
class IndividualStats:
    """Save stats after a fight"""
    individual_idx: int
    enemies_beaten: int
    sum_player_life: float
    sum_time: int
    sum_gain: int

def run_individuals(indexes):
    selected_individuals = DataHandler.get_individuals_by_indexes(indexes)
    all_individual_stats = []

    for individual in selected_individuals:
        enemies_beaten = 0
        sum_player_life = 0
        sum_time = 0
        sum_gain = 0
        for _ in range(5):
            enemies, fitnesses, player_lifes, enemy_lifes, times = env.play(pcont=individual["weights"])
            enemies_beaten = enemies_beaten + enemy_lifes.count(0)
            sum_player_life = sum_player_life + np.sum(player_lifes)
            sum_time = sum_time + np.sum(times)
            sum_gain = sum_gain + np.sum(np.array(player_lifes) - np.array(enemy_lifes))
        individual_stats = IndividualStats (
            individual_idx=individual["idx"],
            enemies_beaten=enemies_beaten,
            sum_player_life=sum_player_life,
            sum_time=sum_time,
            sum_gain=sum_gain
        )
        all_individual_stats.append(individual_stats)

    most_enemies_beaten = sorted(all_individual_stats, key=lambda x: x.enemies_beaten, reverse=True)[0]
    highest_sum_player_life = sorted(all_individual_stats, key=lambda x: x.sum_player_life, reverse=True)[0]
    highest_sum_time = sorted(all_individual_stats, key=lambda x: x.sum_time, reverse=True)[0]
    highest_sum_gain = sorted(all_individual_stats, key=lambda x: x.sum_gain, reverse=True)[0]
    print("\n-----------------------\n")
    print(f"Most enemies beaten: {most_enemies_beaten.individual_idx} with {most_enemies_beaten.enemies_beaten}")
    print(f"Highest sum player life: {highest_sum_player_life.individual_idx} with {highest_sum_player_life.sum_player_life}")
    print(f"Highest sum time: {highest_sum_time.individual_idx} with {highest_sum_time.sum_time}")
    print(f"Highest sum gain: {highest_sum_gain.individual_idx} with {highest_sum_gain.sum_gain}")

    pprint(all_individual_stats)

