@dataclass
class IndividualStatsTwo:
    """Save stats after a fight"""
    individual_idx: int
    enemies_beaten: int
    player_life_avg: float
    time_avg: int
    gain_avg: int
    
def run_all_individuals(individuals):
    all_individual_stats = []
    f = open("results.txt",'w')
    for idx, ind in enumerate(individuals):
        enemies, fitnesses, player_lifes, enemy_lifes, times = env.play(pcont=ind)
        enemies_beaten = enemy_lifes.count(0)
        player_life_avg = np.average(player_lifes)
        time_avg = np.average(times)
        gain_avg = np.average(np.array(player_lifes) - np.array(enemy_lifes))
        individual_stats = IndividualStatsTwo (
            individual_idx=idx,
            enemies_beaten=enemies_beaten,
            player_life_avg=player_life_avg,
            time_avg=time_avg,
            gain_avg=gain_avg
        )
        all_individual_stats.append(individual_stats)

    most_enemies_beaten = sorted(all_individual_stats, key=lambda x: x.enemies_beaten, reverse=True)[0]
    highest_avg_player_life = sorted(all_individual_stats, key=lambda x: x.player_life_avg, reverse=True)[0]
    highest_avg_time = sorted(all_individual_stats, key=lambda x: x.time_avg, reverse=True)[0]
    highest_avg_gain = sorted(all_individual_stats, key=lambda x: x.gain_avg, reverse=True)[0]
    print("\n-----------------------\n")
    print(f"Most enemies beaten: {most_enemies_beaten.individual_idx} with {most_enemies_beaten.enemies_beaten}", file=f)
    print(f"Highest avg player life: {highest_avg_player_life.individual_idx} with {highest_avg_player_life.player_life_avg}", file=f)
    print(f"Highest avg time: {highest_avg_time.individual_idx} with {highest_avg_time.time_avg}", file=f)
    print(f"Highest avg gain: {highest_avg_gain.individual_idx} with {highest_avg_gain.gain_avg}", file=f)
    print(all_individual_stats, file=f)

