def get_method(ind_index):
    if ind_index <= 19:
        return "1"
    return "2"

def get_enemy_group(ind_index):
    if ind_index <= 9 or (ind_index >= 20 and ind_index <= 29):
        return "[1,2,3,4]"
    return "[5,6,7,8]"

@dataclass
class IndividualResults:
    individual_index: int
    fights: list
    total_enemy_life_avg: float
    total_player_life_avg: float
    total_gain_avg: float
    total_time_avg: float

@dataclass
class FightResultsAverage:
    enemy: int
    enemy_life_avg: float
    player_life_avg: float
    gain_avg: float
    time_avg: float

@dataclass
class SingleFightResult:
    enemy: int
    enemy_life: float
    player_life: float
    gain: float
    time: float
    
from record_results import record_rank_gain_testing_groups
def run_all_individuals_multiple_times(individuals):
    f = open("final.txt",'w')
    all_individual_results = []
    for individual_index, ind in enumerate(individuals):
        enemies_beaten = 0
        sum_player_life = 0
        sum_time = 0
        sum_gain = 0
        all_single_fight_results = []
        for _ in range(5):
            enemies, fitnesses, player_lifes, enemy_lifes, times = env.play(pcont=ind)
            for idx, enemy in enumerate(enemies):
                single_fight_result = SingleFightResult(
                    enemy = enemy,
                    enemy_life = enemy_lifes[idx],
                    player_life = player_lifes[idx],
                    gain = player_lifes[idx] - enemy_lifes[idx],
                    time = times[idx]
                )
                all_single_fight_results.append(single_fight_result)
        all_fight_results_average = []
        for enemy_idx in range(1, 9):
            current_fight_results = [single_fight_result for single_fight_result in all_single_fight_results if single_fight_result.enemy == enemy_idx]
            enemy_life_avg = np.average([single_fight_result.enemy_life for single_fight_result in current_fight_results])
            player_life_avg = np.average([single_fight_result.player_life for single_fight_result in current_fight_results])
            gain_avg = np.average([single_fight_result.gain for single_fight_result in current_fight_results])
            time_avg = np.average([single_fight_result.time for single_fight_result in current_fight_results])
            fight_results_average = FightResultsAverage(
                enemy = enemy_idx,
                enemy_life_avg = enemy_life_avg,
                player_life_avg = player_life_avg,
                gain_avg = gain_avg,
                time_avg = time_avg
            )
            all_fight_results_average.append(fight_results_average)
        
        individual_result = IndividualResults(
            individual_index = individual_index,
            fights = all_fight_results_average,
            total_enemy_life_avg = np.average([fight_result_avg.enemy_life_avg for fight_result_avg in all_fight_results_average]),
            total_player_life_avg = np.average([fight_result_avg.player_life_avg for fight_result_avg in all_fight_results_average]),
            total_gain_avg = np.average([fight_result_avg.gain_avg for fight_result_avg in all_fight_results_average]),
            total_time_avg = np.average([fight_result_avg.time_avg for fight_result_avg in all_fight_results_average]),
        )
        all_individual_results.append(asdict(individual_result))
        
        method = get_method(individual_index)
        enemy_group = get_enemy_group(individual_index)
        
        result = [{
            'method': method, 
            'gain_rank_avg': individual_result.total_gain_avg,
            'player_life_avg': individual_result.total_player_life_avg, 
            'enemy_life_avg': individual_result.total_enemy_life_avg, 
            'time_avg': individual_result.total_time_avg, 
            'ind_index': individual_index
                }]
        
        record_rank_gain_testing_groups(
            enemy_group = enemy_group,
            method_number = method,
            results = result
        )

    print(all_individual_results, file=f)

run_all_individuals_multiple_times(all_inds)


import tabulate
def create_table(ind):
    f = open("table3.txt",'w')
    fight_results = []
    for _ in range(5):
        enemies, fitnesses, player_lifes, enemy_lifes, times = env.play(pcont=ind)
        for idx, enemy in enumerate(enemies):
            fight_result = FightResults(
                enemy = enemy,
                enemy_life = enemy_lifes[idx],
                player_life = player_lifes[idx]
            )
            fight_results.append(fight_result)
            
    fight_results_average = []
    for enemy_index in range(8):
        enemy = enemy_index + 1
        enemy_fight_results = [fight_result for fight_result in fight_results if fight_result.enemy == enemy]
        enemy_life_average = np.average([fight_result.enemy_life for fight_result in enemy_fight_results])
        player_life_average = np.average([fight_result.player_life for fight_result in enemy_fight_results])
        fight_result_average = FightResultsAverages(
            enemy = enemy,
            enemy_life_average = enemy_life_average,
            player_life_average = player_life_average
        )
        fight_results_average.append(asdict(fight_result_average))
        
    header = fight_results_average[0].keys()
    rows =  [x.values() for x in fight_results_average]
    print(tabulate.tabulate(rows, header), file=f)
    
